import React, { FunctionComponent } from 'react';
import './contactSection.scss';

const ContactSection : FunctionComponent = () => {
    
 return (
    <div className="row skill-ro">
        <div className="col valign-wrapper">
        <img className="imgSkill responsive-img" src="../.././assets/git.png" alt="git"/>
        <img className="imgSkill responsive-img" src="../.././assets/vuejs.png" alt="vuejs"/>
        <img className="imgSkill responsive-img" src="../.././assets/react.png" alt="react"/>
        <img className="imgSkill responsive-img" src="../.././assets/sass.png" alt="sass"/>
        <img className="imgSkill responsive-img" src="../.././assets/php.png" alt="php"/>
        <img className="imgSkill responsive-img" src="../.././assets/laravel.png" alt="laravel"/>
        <img className="imgSkill responsive-img" src="../.././assets/github.png" alt="github"/>
        
        </div>

    </div>
  
 )
}
  
export default ContactSection;
